import React, {useState} from 'react';
import s from './Counter.module.css'
import {Button} from "./Button";



export const Сounter = () => {


    let [value,setValue]=useState(0)

    const onclickHandlerInc = ()=> {
      setValue(value+1 )

    }


    const onclickHandlerReset = ()=>{
        setValue(0)
    }

    const red = {
        color:value>4 ? 'red':'black',
        marginTop:'15px',

    }

    const boxValue = {
        width:'100px',
        height:'50px',
        borderRadius:'5px',
        display:'inline-block',
        border: '1px solid blue',
        backgroundColor: '#61dafb',
        marginTop:'10px'

    }

    const arround = {
        width:'200px',
        height:'100px',
        borderRadius:'5px',
        display:'inline-block',
        border: '1px solid #61dafb',
        fontFamily: "Monotype Corsiva",
        fontSize: '28px',
        fontStyle: 'italic',
        marginTop:'100px'
    }


    return (
        <div className={s.fon}>

            <div style={arround}>
                  <span style={boxValue}>

               <div style={red}>{value}</div></span>
                <div >

                    <Button name={'inc'} started={()=>onclickHandlerInc()} value={value}/>
                    <Button name={'reset'} started={()=>onclickHandlerReset()} />

                </div>
            </div>


        </div>
    );
};
